<script>
function aramayaBasla(str) {
    if (str.length == 0) { 
        document.getElementById("sonuc").innerHTML = "";
        return;
    } else {
        var xmlhttp = new XMLHttpRequest();
        xmlhttp.onreadystatechange = function() {
            if (this.readyState == 4 && this.status == 200) {
                document.getElementById("sonuc").innerHTML = this.responseText;
            }
        };
        xmlhttp.open("GET", "isimler.php?q=" + str, true);
        xmlhttp.send();
    }
}
</script>
</head>
<body>

<div  style="margin-top: 305px;"  class="input-group input-group-sm mb-3">


<img style="    width: 300px;
    position: absolute;
    top: -280%;
    left: 40%;
}" src="data:image/webp;base64,">


  <div style="width: 100px;margin-left:280px;" class="input-group-prepend">
    
  </div>
<div style="width: 600px;">
<input style="    box-shadow: 0px 1px 10px #827d7d24;
    border: 1px solid hsl(0, 0%, 85%);" type="text" onkeyup="aramayaBasla(this.value)" class="form-control">
</div>
</div>

<span id="sonuc"></span>
</body>
